population = []
def createPopulation():
    #Create an array of size 100 to hold 100 different chromosomes. Start them as 1000 0's to be changed later.
    popHolder = ""
    for y in range(0, 1000):
        popHolder += "0"
    for i in range(0, 100):
        population.append(popHolder)

    #For each chromosome, change up to 4 of the 1000 possible values to 1 instead of 0. Can be less if the randomint takes the space of a previously assigned space.
    for a in range(0, 100):
        for b in range(0, 4):
            randHolder = random.randint(0,1000)
            population[a] = population[a][:randHolder-1] + "1" + population[a][randHolder+1:]
        

